import React from 'react';
import Routes from './Routes.js';
import { Provider } from 'react-redux';
import { store } from './store/store';
import bootstrap from 'bootstrap/dist/css/bootstrap.min.css';

const App = ()=>(
  <Provider store={store}>
    <Routes />
  </Provider>
);

export default App;
